function UnitInput(props) {
    return (
        <div className="group">
            <input type="text" value={props.weight}></input>
            <select value={props.unit}>
                {props.units.map((unit => (
                    <option value={unit}>{unit}</option>
                )))}
            </select>
        </div>
    );
}

export default UnitInput;
